import React from 'react';
import PropTypes from 'prop-types';

Todo.propTypes = {};

function Todo({ data }) {
	// console.log(data);

	const handleRemove = (id) => {
		console.log(id);
	};

	return (
		<div>
			<p>{data.title}</p>
			<button onClick={handleRemove}>remove</button>
		</div>
	);
}

export default Todo;
